import React from 'react';
import { LineChart, Line, XAxis, YAxis, ZAxis, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import moment from 'moment';

const statusColors = {
  online: 'green',
  offline: 'grey',
  idle: 'orange',
  dnd: 'red',
};

const StatusChart = ({}) => {
  const chartData = [
    { username: "a", timestamp: 1, status: "online" },
    { username: "b", timestamp: 1, status: "online" },
    { username: "a", timestamp: 2, status: "online" },
    { username: "b", timestamp: 2, status: "online" },
    { username: "a", timestamp: 3, status: "online" },
    { username: "b", timestamp: 3, status: "online" },
  ]
  console.log(chartData)
  return (
    <ResponsiveContainer width='95%' height={100}>
      <LineChart>
        <XAxis
          dataKey='timestamp'
          domain={['auto', 'auto']}
          name='Time'
          type='number'
        />
        <YAxis type='category' dataKey='username' />
        <ZAxis type="category" dataKey="status" />
        <Tooltip cursor={{ strokeDasharray: '3 3' }} />

        {Object.keys(statusColors).map((status) => (
          <Line
            key={status}
            data={chartData.filter((entry) => entry.status === status).slice(0, 1000)}
            type="monotone"
            dataKey="username"
            stroke={statusColors[status]}
          />
        ))}
      </LineChart>
    </ResponsiveContainer>
  );
};

export default StatusChart;
